function [lambda,l,sols] = solver_changeofscale_32_new_basis_d2(x11,x12,x13,x21,x22,iters)
% x11 <-> x12 <-> x13,  x21 <-> x22
% size(x11) = [2,3]
if nargin < 6
    iters = 0;
end

data = [x11(:);x12(:);x13(:);x21(:);x22(:)];

% We do some rescaling of the image coordinates (and lambda)
% I'm not sure what is the best way to do this (or if it is even necessary)
scale_x = (mean(abs(data)));
data = data/scale_x;
d2 = data(1:2:end).^2 + data(2:2:end).^2;
scale_lambda = mean(d2);
d2 = d2 / scale_lambda;

% precompute 2x2 subdets
ind1 = [3,1,1,9,7,7,15,13,13,21,19,19,27,25,25];
ind2 = [6,6,4,12,12,10,18,18,16,24,24,22,30,30,28];
ind3 = [5,5,3,11,11,9,17,17,15,23,23,21,29,29,27];
ind4 = [4,2,2,10,8,8,16,14,14,22,20,20,28,26,26];
xd = data(ind1).*data(ind2)-data(ind3).*data(ind4);
data = [data;xd;d2];

sols = solve(data);
ind_r = max(abs(imag(sols)))<1e-6;
sols = real(sols(:,ind_r));
lambda = sols(1,:);
l = [sols(2:3,:);ones(1,size(sols,2))];

% Perform some refinement on the roots
d = data(1:2:30).^2 + data(2:2:30).^2;
x = reshape(data(1:30),2,15);
for k = 1:size(sols,2)
    [lambda(k),l(:,k)] = refine_root(lambda(k),l(:,k),x,d2',xd',iters);
end

lambda = lambda / scale_x^2 / scale_lambda;
l(1:2,:) = l(1:2,:) / scale_x;

function [q,l] = refine_root(q,l,x,d,xd,iters)
F = zeros(3,1);
J = zeros(3,3);


ind1 = [1 2 3;
        1 2 3;
        4 5 6;
        10 11 12];

ind2 = [4 5 6;
        7 8 9;
        7 8 9;
        13 14 15];


for iter = 1:iters
    for k = 1:4        
        x1 = x(:,ind1(k,:)); x2 = x(:,ind2(k,:));
        x1d = xd(ind1(k,:)); x2d = xd(ind2(k,:));
        d1 = d(ind1(k,:)); d2 = d(ind2(k,:));
        
        % f = det(xp), g = prod(alpha)
        
        df1_dq = d1(1)*x1d(1) - d1(2)*x1d(2) + d1(3)*x1d(3);
        df2_dq = d2(1)*x2d(1) - d2(2)*x2d(2) + d2(3)*x2d(3);
        
        f1 = (1+q*d1(1))*x1d(1) - (1+q*d1(2))*x1d(2) + (1+q*d1(3))*x1d(3);
        f2 = (1+q*d2(1))*x2d(1) - (1+q*d2(2))*x2d(2) + (1+q*d2(3))*x2d(3);
        
        a1 = l' * [x1; 1 + q*d1];
        a2 = l' * [x2; 1 + q*d2];
        
        g1 = a1(1)*a1(2)*a1(3);
        g2 = a2(1)*a2(2)*a2(3);
        
        dg1_dq = d1(1)*a1(2)*a1(3) + a1(1)*d1(2)*a1(3) + a1(1)*a1(2)*d1(3);
        dg2_dq = d2(1)*a2(2)*a2(3) + a2(1)*d2(2)*a2(3) + a2(1)*a2(2)*d2(3);
        
        dg1_dl1 = x1(1,1)*a1(2)*a1(3) + a1(1)*x1(1,2)*a1(3) + a1(1)*a1(2)*x1(1,3);
        dg2_dl1 = x2(1,1)*a2(2)*a2(3) + a2(1)*x2(1,2)*a2(3) + a2(1)*a2(2)*x2(1,3);
        
        dg1_dl2 = x1(2,1)*a1(2)*a1(3) + a1(1)*x1(2,2)*a1(3) + a1(1)*a1(2)*x1(2,3);
        dg2_dl2 = x2(2,1)*a2(2)*a2(3) + a2(1)*x2(2,2)*a2(3) + a2(1)*a2(2)*x2(2,3);
        
        %         % inverse fractional s = g_1 / f_1
        %         ds1_dq = dg1_dq / f1  - g1 * df1_dq / f1^2;
        %         ds2_dq = dg2_dq / f2  - g2 * df2_dq / f2^2;
        %         ds1_dl1 = dg1_dl1 / f1; ds2_dl1 = dg2_dl1 / f2;
        %         ds1_dl2 = dg1_dl2 / f1; ds2_dl2 = dg2_dl2 / f2;
        %
        %         F(k) = g1/f1 - g2/f2;
        %         dF_dq = ds1_dq - ds2_dq;
        %         dF_dl1 = ds1_dl1 - ds2_dl1;
        %         dF_dl2 = ds1_dl2 - ds2_dl2;
        
        % cross multiplication f1*g2 - f2*g2
        F(k) = f1*g2 - f2*g1;
        dF_dq = df1_dq*g2 + f1*dg2_dq - df2_dq*g1 - f2*dg1_dq;
        dF_dl1 = f1*dg2_dl1 - f2*dg1_dl1;
        dF_dl2 = f1*dg2_dl2 - f2*dg1_dl2;
        
        J(k,:) = [dF_dq dF_dl1 dF_dl2];
    end
    if norm(F) < 1e-10
        break;
    end
    
    dx = -J\F;
    q = q + dx(1);
    l(1:2) = l(1:2) + dx(2:3);
end



